import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

const logo =
  "data:image/png;base64,";
const pdfContent = (sections, pdfSettings) => {
  const pageSize = {
    width: 560,
    height: 250,
  };
  const pageMargins = [40, 60, 40, 60];
  let content = [];
  if (pdfSettings) {
    let { title, name, roll, faculty, attributed } = pdfSettings;
    content.push(
      attributed
        ? {
            image: logo,
            width: 70,
          }
        : null,
      attributed
        ? {
            text: "Made with scanOnline",
            link: "https://scanonline100.web.app",
            margin: 0,
            fontSize: 10,
            bold: true,
            color: "#844494",
            decoration: "underline",
          }
        : null,
      {
        text: "Title",
        fontSize: 16,
        alignment: "center",
        marginTop: attributed ? pageSize.height * 0.08 : pageSize.height * 0.2,
      },
      {
        text: title,
        fontSize: 20,
        alignment: "center",
        margin: 10,
        bold: true,
      },
      {
        text: "_______________________________",
        fontSize: 14,
        alignment: "center",
      },
      name
        ? {
            text: `Name: ${name}`,
            style: "text",
          }
        : null,
      roll
        ? {
            text: `Roll No: ${roll}`,
            style: "text",
          }
        : null,
      faculty
        ? {
            text: `Faculty: ${faculty}`,
            style: "text",
            pageBreak: "after",
          }
        : null
    );
  }
  sections.forEach((section, si, sections) => {
    content.push({
      image: section.image,
      alignment: "center",
      height: 560,
      width: 250,
    });
    if (si === sections.length - 1) return;
    content.push({
      text: "",
      pageBreak: "after",
    });
  });
  return {
    pageSize,
    content,
    pageMargins,
  };
};

export const PrintPdf = (sections, pdfSettings, pageWidth, pageHeight) => {
  const { pageSize, content, pageMargins } = pdfContent(
    sections,
    pageWidth,
    pageHeight,
    pdfSettings
  );
  const docDefinition = {
    pageSize,
    content,
    pageMargins,
    styles: {
      text: {
        fontSize: 16,
        alignment: "center",
        margin: 10,
      },
    },
  };
  pdfMake.createPdf(docDefinition).open();
};
